;; **
;;; ## Evolutions
;; **

;; @@
(defn plot-radius-evolution [[id author]]
(let [curr (map :mean (temporal-radius id t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Minutes"]
         [:theme_bw]
         [:ggtitle (str "Average temporal radius evolution of " (element-name author))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;serene-fern/plot-radius-evolution</span>","value":"#'serene-fern/plot-radius-evolution"}
